import React, { useState, useEffect } from "react";

const UserList = () => {
  let [alldata, updateAlldata] = useState([]);
  const getuserinfo = () => {
    fetch("http://localhost:1250/details")
      .then((response) => response.json())
      .then((info) => {
        updateAlldata(info);
      });
  };
  useEffect(() => {
    getuserinfo();
    console.log(alldata);
  }, [1]);
  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-lg-3 border">
          <h4>Available Profile</h4>
          <div>
            {alldata.map((data, index) => {
              return (
                <div key={index}>
                  <h5 className="text-primary">
                    <a target="iframe_a">{data.firstname}</a>
                  </h5>
                </div>
              );
            })}
          </div>
        </div>
        <div className="col-lg-9">
          <div id="target" className="form bg-white shadow-lg rounded">
            <iframe
              name="iframe_a"
              height="300px"
              width="100%"
              className="border:none"
            ></iframe>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserList;
